import React from 'react';
import logo from "../../assets/logo.png";

const Header = () => {
  return (
    <div className='w-50 mx-auto'>
      <div>
        <ul>
          <li>Blog</li>
          <li>About Us</li>
        </ul>
      </div>
      <img src={logo} alt="" />
      <div>
        <ul>
          <li>Blog</li>
          <li>About Us</li>
        </ul>
      </div>
    </div>
  )
}

export default Header;
